function HandleCubesListResponse(n){if(n.length>0){$("#CubeId").empty();$("#CubeId").append("<option selected disabled>No cube selected<\/option>");for(var t=0;t<n.length;t++)$("#CubeId").append('<option value="'+n[t].identity+'">'+n[t].manufacturer.name+" "+n[t].modelName+" "+n[t].plasticColor.name+"<\/option>");$("#CubeId").removeAttr("disabled");DisableOptionsComboBox()}else $("#CubeId").attr("disabled",!0)}function HandleOptionsListResponse(n){if(n.length>0){$("#CategoryOptionId").empty();$("#CategoryOptionId").append("<option selected disabled>No option selected<\/option>");for(var t=0;t<n.length;t++)$("#CategoryOptionId").append('<option value="'+n[t].identity+'">'+n[t].name+"<\/option>");$("#CategoryOptionId").removeAttr("disabled")}else $("#CategoryOptionId").attr("disabled",!0)}function DisableOptionsComboBox(){$("#CategoryOptionId").empty();$("#CategoryOptionId").append("<option selected disabled>No option selected<\/option>");$("#CategoryOptionId").prop("selectedIndex",0);$("#CategoryOptionId").attr("disabled",!0)}$("#StartTimeStamp").datetimepicker({format:"L"});$("#EndTimeStamp").datetimepicker({format:"L"});$("#AdjustButton").click(function(){$("#StartDate").val("");$("#EndDate").val("");$("#CategoryId").val(0);$("#CubeId").prop("selectedIndex",0);$("#CategoryOptionId").prop("selectedIndex",0);$("#CubeId").attr("disabled",!0);$("#CategoryOptionId").attr("disabled",!0);$("#SeriesAmount").val($("#DefaultLimit").val());$("#AdjustModal").modal("show")});$("#CategoryId").change(function(){let n=$("#CategoryId").val(),t=$("#UserId").val();$.get("/Series/GetUserCubesInCategoryList",{id:t,categoryId:n},function(n){n.idFaulted&&$("#AdjustModal").modal("hide");ResponseCheck(n,HandleCubesListResponse)})});$("#CubeId").change(function(){let n=$("#CubeId").val(),t=$("#UserId").val();$.get("/Series/GetUserCategoryOptionsOfCubeList",{id:t,cubeId:n},function(n){n.idFaulted&&$("#AdjustModal").modal("hide");ResponseCheck(n,HandleOptionsListResponse)})});